import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Navbar from "./components/Nav/Navbar"
import Search from "./pages/Search"
import Saved from "./pages/Saved"
import './App.css';

function App() {
  return (
    <Router>
      <Navbar />
      <Route exact path = "/" components ={Search}></Route>
      <Route exact path = "/saved" components ={Saved}></Route>
      <Route exact path = "/books/:id" components ={Saved}></Route>

    </Router>
  )

}

export default App;
